window.bookSummaryJSON = "<p><b>Max wanted to be a [Baker].</b></p> <p>Settle down, bake stuff, and enjoy life. The gods, however, ruined that dream.</p> <p>Given [Baker] and a rare black skill, he is now running for his life, trying to grow strong enough to return home. Now, Max must find a way to grow strong enough to survive the people and the god hunting him. Unprepared for an adventurer's life, Max will have to learn things the hard way as he hides his secret lest his fellow adventurers turn on him.</p>"; 
